    private BitmapDescriptor bitmapDescriptorFromVector(Context context, int vectorResId) {
        Drawable vectorDrawable = ContextCompat.getDrawable(context, vectorResId);
        vectorDrawable.setBounds(0, 0, vectorDrawable.getIntrinsicWidth(), vectorDrawable.getIntrinsicHeight());
        Bitmap bitmap = Bitmap.createBitmap(vectorDrawable.getIntrinsicWidth(), vectorDrawable.getIntrinsicHeight(), Bitmap.Config.ARGB_8888);
        Canvas canvas = new Canvas(bitmap);
        vectorDrawable.draw(canvas);
        return BitmapDescriptorFactory.fromBitmap(bitmap);
    }



    void getall(ArrayList<String> string) {
        Collections.sort(string, new sortarray1());
        arrayString.clear();
        try {
            JSONArray jsonArray = (JSONArray) new JSONArray(string.get(0));
            int i;
            for (i = 0; i < 20; i++) {
                JSONObject jsonObject = (JSONObject) jsonArray.get(i);
                arrayString.add(new Pair<Double, Double>(jsonObject.optDouble("first"), jsonObject.optDouble("second")));
            }
        } catch (JSONException e) {
            e.printStackTrace();
        }
        Collections.sort(arrayString, new sortarray());
        if(mMap!=null)
            mMap.clear();

        LatLng latLng = null;
        int k=20;
        if(arrayString.size()<20)
            k=arrayString.size();
        for (int i = 0; i < k; i++) {
            latLng = new LatLng(arrayString.get(i).first, arrayString.get(i).second);
            Marker marker = mMap.addMarker(new MarkerOptions()
                    .position(latLng)
                    .title("Get Direction")
                    .icon(bitmapDescriptorFromVector(getContext(), R.drawable.ic_place_black_24dp)));
            marker.showInfoWindow();
            CustomInfoWindow customInfoWindow = new CustomInfoWindow(getActivity());
            mMap.setInfoWindowAdapter(customInfoWindow);
            marker.showInfoWindow();
            mMap.setOnInfoWindowClickListener(new GoogleMap.OnInfoWindowClickListener() {
                @Override
                public void onInfoWindowClick(Marker marker) {
                    try {
                        Intent intent = new Intent(Intent.ACTION_VIEW,
                                Uri.parse("http://maps.google.com/maps?daddr=" + marker.getPosition().latitude+','+ marker.getPosition().longitude));
                        getContext().startActivity(intent);
                    } catch (Exception e) {

                    }
                }
            });

        }
        mMap.moveCamera(CameraUpdateFactory.newLatLngZoom(new LatLng(arrayString.get(0).first, arrayString.get(0).second),8));
    }

    class sortarray implements Comparator<Pair<Double,Double>> {

        float[] res = new float[1];
        float[] res1 = new float[1];

        @Override
        public int compare(Pair<Double,Double> o1, Pair<Double,Double> o2) {
            Location.distanceBetween(mylocation.getLatitude(), mylocation.getLongitude(),
                    o1.first, o1.second, res);
            Location.distanceBetween(mylocation.getLatitude(), mylocation.getLongitude(),
                    o2.first, o2.second, res1);
            return (int) (res[0] - res1[0]);
        }
    }

    class sortarray1 implements Comparator<String> {

        float[] res = new float[1];
        float[] res1 = new float[1];

        @Override
        public int compare(String o1, String o2) {
            Pair<Double, Double> p1=null,p2=null;
            try {
                JSONArray jsonArray = (JSONArray) new JSONArray(o1);
                JSONArray jsonArray1 = (JSONArray) new JSONArray(o2);
                JSONObject jsonObject = (JSONObject) jsonArray.get(0);
                JSONObject jsonObject1 = (JSONObject) jsonArray1.get(0);
                p1=new Pair<Double, Double>(jsonObject.optDouble("first"), jsonObject.optDouble("second"));
                p2=new Pair<Double, Double>(jsonObject1.optDouble("first"), jsonObject1.optDouble("second"));
            } catch (JSONException e) {
                e.printStackTrace();
            }
            if(p1!=null && p2!=null) {
                Location.distanceBetween(mylocation.getLatitude(), mylocation.getLongitude(),
                        p1.first, p1.second, res);
                Location.distanceBetween(mylocation.getLatitude(), mylocation.getLongitude(),
                        p2.first, p2.second, res1);
            }
            return (int) (res[0] - res1[0]);
        }
    }
